head.ready(function() {
	var Default = {
		utils : {
			links : function(){
				$('a[rel*=external]').bind('click',function(e){
					e.preventDefault();
					window.open($(this).attr('href'));						  
				});
			},
			mails : function(){
				$('.email').each(function(index){
					tr = $(this).text().replace('//','@');
					tr = tr.replace('/','.');
					$(this).text(tr);
					$(this).attr('href','mailto:'+tr);
				});
			},
			nav : function(){
				$('#nav > ul > li, #cart').on({
					mouseenter: function(){
						if($(this).children('ul, div').css('display') != 'block'){
							$(this).children('ul, div').slideDown('fast');
						}
					}, 						
					mouseleave: function(){
						if($(this).children('ul, div').css('display') != 'none'){
							$(this).children('ul, div').slideUp('fast');	
						}						
					}}
				);			
			},
			forms : function(){
				$('#top input').each(function(){
					if($(this).val() !== '') $(this).parent().children('label').css('margin-top','-3000em');
				}).bind('focus',function(){
					$(this).parent().children('label').css('margin-top','-3000em');
				}).bind('blur',function(){
					if($(this).val() === '') $(this).parent().children('label').css('margin-top','0');
				});
				var ixa = $('fieldset > *, .product-a > *:first-child form fieldset > ul > li, .table-a td, .tabs-b p');
				var ixb = parseInt(ixa.size());
				ixa.each(function(){ $(this).css({'z-index':ixb}); ixb--; });
				$('.filter-a select, .product-a > *:first-child form ul li select, .table-a select, .tabs-b select').parent().jNice();
				$('.form-a [required], .form-b [required], .form-d [required], .tabs-b p.required select, .tabs-b [required]').each(function(){$(this).prev('label').append('<span> *</span>');});	
			},
			date : function(){
				$('#footer .date').text((new Date).getFullYear());
			},
			heights : function(){
				$('.double-a').each(function(){ $(this).children().equalHeights(); });
				$('.double-a').each(function(){ $(this).children().children('fieldset').equalHeights(); });
			},
			accordion : function(){
				$('.accordion-a > h3:first-child').addClass('active');
				$('.accordion-a > h3:not(:first-child) + div').hide();
				$('.accordion-a > h3').on('click',function(){ 
					if($(this).hasClass('active')){
						$(this).removeClass('active');
						$(this).next().slideUp(); 
						return false;
					}
					else {
						$('.accordion-a > h3').removeClass('active');
						$(this).addClass('active');
						$('.accordion-a > div').slideUp(); 
						$(this).next().slideDown(); 
						return false;
					}
				});				
			},
			miscellaneous : function(){
				$('.active > a').bind('click',function(){ return false }).css('cursor','default').css('text-decoration','none');
				$('.vcard.a > li, #nav > ul.a, .product-a > aside > figure a, .tabs-b > ul li, #cart > div').append('<div class="fit-a"></div>');
				$('.icons-a a, .header-a').wrapInner('<span></span>');
				$('.product-a .addthis_toolbox').wrap('<div class="addthis-a"></div>');
				var tn=1; $('.accordion-a h3').each(function(){$(this).prepend('<span>0'+tn+':</span> '); tn++;});
				$.tools.tabs.addEffect('custom', function(tabIndex, done) { this.getPanes().css('display','block').css('position','absolute').css('left','-3000em').css('top','-3000em').eq(tabIndex).css('display','block').css('position','relative').css('left','0').css('top','0'); done.call(); });	
				$('.tabs-a').each(function(){ $(this).children('ul').tabs($(this).children('div').children('div'), { effect: 'custom', onClick: function(index){ $('.scroller-a').jScrollPane({ verticalDragMinHeight: 38, verticalDragMaxHeight: 38, horizontalDragMinWidth: 12, horizontalDragMaxWidth: 12, showArrows: false }); } }); });
				$('.tabs-b').each(function(){ $(this).children('ul').tabs($(this).children('div').children('div')); });
				$('.product-a > aside > figure a').attr('rel','a').fancybox({ overlayShow: true, overlayColor: '#000', overlayOpacity: 0.9, titleShow: false });
				$('.product-a > aside > figure').after('<div class="navi-wrapper"><ul class="navi"></ul> <a class="prev">Previous</a><a class="next">Next</a></div>').cycle({ 
					timeout: 0, 
					pager: '.navi',      
					next: '.navi-wrapper .next', 
					prev: '.navi-wrapper .prev',
					pagerAnchorBuilder: function(idx, slide) { 
						return '<li><a href="#"><img src="'+($(slide).attr('src')==undefined?$(slide).children('img').attr('src'):$(slide).attr('src'))+'" width="78"></a></li>';
					} 
				});
				$('#cart > p').each(function(){ $(this).find('a').clone().addClass('link').appendTo($(this)); });
				$('.news-b > * > div').each(function(){ $(this).css('width',Math.round($(this).next('figure').children('img').width()-28)+'px'); });
				$('.news-b > * > div').each( function() { if($(this).next('figure').children('img').width()>300){ $(this).addClass('a'); }});
				$('.slider-a, #featured').wrapInner('<div class="inner"></div>');
				$('.scroller-a').jScrollPane({ verticalDragMinHeight: 38, verticalDragMaxHeight: 38, horizontalDragMinWidth: 12, horizontalDragMaxWidth: 12, showArrows: false });
				$('.scroller-b').wrap('<div class="scroller-b-wrapper"></div>').parent('.scroller-b-wrapper').jScrollPane({ horizontalDragMinHeight: 38, horizontalDragMaxHeight: 38, horizontalDragMinWidth: 12, horizontalDragMaxWidth: 12, showArrows: false });
				$('.slider-a .news-b, #featured article').wrap('<div></div>');
				$('.slider-a > .inner, #featured > .inner').each(function(){ $(this).bxSlider({ pager: false, controls: true, useCSS: false }); });
				$('#featured article.a > *').after('<br>');
				
				$('.map-a').attr('id','mapa');
				$('#mapa').gmapembedd('jaipur,rajasthan,India');
			}
		},
		ie : {
			css : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					$('body').append('<p class="lt-ie9">Your browser is ancient! <a target="_blank" href="http://browsehappy.com/">Upgrade to a different browser</a> or <a target="_blank" href="http://www.google.com/chromeframe/?redirect=true">install Google Chrome Frame</a> to experience this site.</p>').css('padding-top','28px');
					$(':last-child').addClass('last-child');
				}				
				if($.browser.msie && parseInt($.browser.version,10) < 8){
					
				}
			},
			pie : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					if(window.PIE){
						$('.image-a > span, .image-b .dots > span').each(function() {
							PIE.attach(this);
						});
					}				
				}
			}
		}

	};

	Default.utils.links();
	Default.utils.mails();
	Default.utils.forms();
	Default.utils.date();
	Default.utils.heights();
	Default.utils.nav();
	Default.utils.miscellaneous();
	Default.utils.accordion();
	Default.ie.css();
	Default.ie.pie();
});

